import React from 'react';
import styles from './Cartelera.module.css';

function Cartelera() {
  return (
    <div className={styles['cartelera-container']}>
      <div className={styles['title']}>En cartelera</div>
      <div className={styles['all-movies']}>
        <div className={styles['movie']}>
          <h3>Título de la película 1</h3>
          <img src="ruta_de_la_imagen_1" alt="Película 1" />
          <button>Ver detalles</button>
        </div>
        <div className={styles['movie']}>
          <h3>Título de la película 2</h3>
          <img src="ruta_de_la_imagen_2" alt="Película 2" />
          <button>Ver detalles</button>
        </div>
        {/* Repite esto para las demás películas */}
      </div>
    </div>
  );
}

export default Cartelera;
